import React, {useState} from "react";
import Modal from 'react-modal';

function Navbar(){

    const [modalIsOpen, setModalIsOpen] = useState(false)

    function addDemot(){
        setModalIsOpen(!modalIsOpen)
    }

    return (<nav class="navbar navbar-expand-lg navbar-dark bg-dark justify-content-center">
    <a class="navbar-brand abs" href="#">DEMOT</a>
    <Modal className="addDemotModal" isOpen={modalIsOpen}><h1>Modal blabla</h1><button onClick={() => {addDemot()}}>CLOSE</button></Modal>
    <div class="collapse navbar-collapse flex-grow-1 text-right" id="myNavbar">
        <ul class="navbar-nav ml-auto flex-nowrap">
            <li class="nav-item">
                <button onClick={() => {addDemot()}} className="nav-link m-2 menu-item addButton"></button>
            </li>
            <li class="nav-item">
                <a href="#" class="nav-link m-2 menu-item">Logout</a>
            </li>
        </ul>
    </div>
  </nav>)
}

export default Navbar
